import axios from 'axios';
import { config } from '../config';

export default {
    SiBannerListgnup: () => {
        return axios.get(config.baseApiUrl + "api/list/banner-list")
            .then(response => {
                return response;
            }).catch({ status: 500, message: 'Internal Server Error' });
    }
}
